webpackJsonp([27],{eUx4:function(s,a){s.exports='<h1 id="pagination">Pagination</h1>\n<blockquote>\n<p>Quick first, previous, next, last, and page buttons for pagination control\nof another component (such as <code>&lt;b-table&gt;</code>).</p>\n</blockquote>\n<pre class="hljs"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">div</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">h6</span>&gt;</span>Default<span class="hljs-tag">&lt;/<span class="hljs-name">h6</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">b-pagination</span> <span class="hljs-attr">size</span>=<span class="hljs-string">&quot;md&quot;</span> <span class="hljs-attr">:total-rows</span>=<span class="hljs-string">&quot;100&quot;</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentPage&quot;</span> <span class="hljs-attr">:per-page</span>=<span class="hljs-string">&quot;10&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">b-pagination</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">br</span>&gt;</span>\n\n    <span class="hljs-tag">&lt;<span class="hljs-name">h6</span>&gt;</span>Small<span class="hljs-tag">&lt;/<span class="hljs-name">h6</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">b-pagination</span> <span class="hljs-attr">size</span>=<span class="hljs-string">&quot;sm&quot;</span> <span class="hljs-attr">:total-rows</span>=<span class="hljs-string">&quot;100&quot;</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentPage&quot;</span> <span class="hljs-attr">:per-page</span>=<span class="hljs-string">&quot;10&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">b-pagination</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">br</span>&gt;</span>\n\n    <span class="hljs-tag">&lt;<span class="hljs-name">h6</span>&gt;</span>Large<span class="hljs-tag">&lt;/<span class="hljs-name">h6</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">b-pagination</span> <span class="hljs-attr">size</span>=<span class="hljs-string">&quot;lg&quot;</span> <span class="hljs-attr">:total-rows</span>=<span class="hljs-string">&quot;100&quot;</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentPage&quot;</span> <span class="hljs-attr">:per-page</span>=<span class="hljs-string">&quot;10&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">b-pagination</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">br</span>&gt;</span>\n\n    <span class="hljs-tag">&lt;<span class="hljs-name">div</span>&gt;</span>currentPage: {{currentPage}}<span class="hljs-tag">&lt;/<span class="hljs-name">div</span>&gt;</span>\n  <span class="hljs-tag">&lt;/<span class="hljs-name">div</span>&gt;</span>    \n<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>\n\n<span class="hljs-tag">&lt;<span class="hljs-name">script</span>&gt;</span><span class="javascript">\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n  data () {\n    <span class="hljs-keyword">return</span> {\n      <span class="hljs-attr">currentPage</span>: <span class="hljs-number">3</span>\n    }\n  }\n}\n</span><span class="hljs-tag">&lt;/<span class="hljs-name">script</span>&gt;</span>\n\n<span class="hljs-comment">&lt;!-- pagination-1.vue --&gt;</span>\n</pre>\n<h2 id="overview">Overview</h2>\n<p><code>&lt;b-pagination&gt;</code> is a custom input component that provides a current page number\ninput control. The value should be bound via <code>v-model</code> in your app. Page numbers\nare indexed from 1. The number of pages is computed from the provided prop\nvalues for <code>total-rows</code> and <code>per-page</code>.</p>\n<h2 id="customizing">Customizing</h2>\n<p><code>&lt;b-pagination&gt;</code> supports several props that allow you to customize the appearance.</p>\n<table class="table b-table table-sm table-striped">\n<thead class="thead-default">\n<tr>\n<th>Prop</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>limit</code></td>\n<td>Limit the maximum number of displayed page buttons (including ellipsis if present, and excluding first/prev/next/last buttons)</td>\n</tr>\n<tr>\n<td><code>total-rows</code></td>\n<td>The total number of records in your data</td>\n</tr>\n<tr>\n<td><code>per-page</code></td>\n<td>The maximum number of data records per page</td>\n</tr>\n<tr>\n<td><code>first-text</code></td>\n<td>The &quot;goto first page&quot; button text (html supported)</td>\n</tr>\n<tr>\n<td><code>prev-text</code></td>\n<td>The &quot;goto previous page&quot; button text (html supported)</td>\n</tr>\n<tr>\n<td><code>next-text</code></td>\n<td>The &quot;goto next page&quot; button text (html supported)</td>\n</tr>\n<tr>\n<td><code>last-text</code></td>\n<td>The &quot;goto last page&quot; button text (html supported)</td>\n</tr>\n<tr>\n<td><code>ellipsis-text</code></td>\n<td>the <code>...</code> indicator text (html supported)</td>\n</tr>\n<tr>\n<td><code>hide-ellipsis</code></td>\n<td>never show ellipsis indicators</td>\n</tr>\n<tr>\n<td><code>hide-goto-end-buttons</code></td>\n<td>never display goto first/last buttons</td>\n</tr>\n</tbody>\n</table>\n<p>Ellipsis inidcator(s) will only be ever shown at the front and/or end of\nthe page number buttons. For <code>limit</code> values less than or equal to <code>3</code>, the ellipsis\nindicator(s) will never be shown for practical display reasons.</p>\n<h2 id="alignment">Alignment</h2>\n<p>By default the pagination component is left aligned. Change the alignment to\n<code>center</code> or <code>right</code> (<code>right</code> is an alias for <code>end</code>) by setting the prop\n<code>align</code> to the appropriate value.</p>\n<pre class="hljs"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">div</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">h6</span>&gt;</span>Left alignment (default)<span class="hljs-tag">&lt;/<span class="hljs-name">h6</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">b-pagination</span> <span class="hljs-attr">:total-rows</span>=<span class="hljs-string">&quot;100&quot;</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentPage&quot;</span> <span class="hljs-attr">:per-page</span>=<span class="hljs-string">&quot;10&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">b-pagination</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">br</span>&gt;</span>\n\n    <span class="hljs-tag">&lt;<span class="hljs-name">h6</span>&gt;</span>Center alignment<span class="hljs-tag">&lt;/<span class="hljs-name">h6</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">b-pagination</span> <span class="hljs-attr">align</span>=<span class="hljs-string">&quot;center&quot;</span> <span class="hljs-attr">:total-rows</span>=<span class="hljs-string">&quot;100&quot;</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentPage&quot;</span> <span class="hljs-attr">:per-page</span>=<span class="hljs-string">&quot;10&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">b-pagination</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">br</span>&gt;</span>\n\n    <span class="hljs-tag">&lt;<span class="hljs-name">h6</span>&gt;</span>Right (end) alignment<span class="hljs-tag">&lt;/<span class="hljs-name">h6</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">b-pagination</span> <span class="hljs-attr">align</span>=<span class="hljs-string">&quot;right&quot;</span> <span class="hljs-attr">:total-rows</span>=<span class="hljs-string">&quot;100&quot;</span> <span class="hljs-attr">v-model</span>=<span class="hljs-string">&quot;currentPage&quot;</span> <span class="hljs-attr">:per-page</span>=<span class="hljs-string">&quot;10&quot;</span>&gt;</span>\n    <span class="hljs-tag">&lt;/<span class="hljs-name">b-pagination</span>&gt;</span>\n    <span class="hljs-tag">&lt;<span class="hljs-name">br</span>&gt;</span>\n\n    <span class="hljs-tag">&lt;<span class="hljs-name">div</span>&gt;</span>currentPage: {{currentPage}}<span class="hljs-tag">&lt;/<span class="hljs-name">div</span>&gt;</span>\n  <span class="hljs-tag">&lt;/<span class="hljs-name">div</span>&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>\n\n<span class="hljs-tag">&lt;<span class="hljs-name">script</span>&gt;</span><span class="javascript">\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n  data () {\n    <span class="hljs-keyword">return</span> {\n      <span class="hljs-attr">currentPage</span>: <span class="hljs-number">3</span>\n    }\n  }\n}\n</span><span class="hljs-tag">&lt;/<span class="hljs-name">script</span>&gt;</span>\n\n<span class="hljs-comment">&lt;!-- pagination-2.vue --&gt;</span>\n</pre>\n<h2 id="small-screen-support">Small screen support</h2>\n<p>On smaller screens (i.e. mobile), some of the <code>&lt;b-pagination&gt;</code> buttons will be hidden to\nminimize the potential of the pagination interface wrapping onto multiple lines:</p>\n<ul>\n<li>The ellipsis indicators will be hidden on screens <code>xs</code> and smaller.</li>\n<li>Page number buttons will be limited to a maximum of 3 visible on <code>xs</code> screens and smaller.</li>\n</ul>\n<p>This ensures that no more than 3 page number buttons are visible,\nalong with the goto <em>first</em>, <em>prev</em>, <em>next</em>, and <em>last</em> buttons.</p>\n<h2 id="accessibility">Accessibility</h2>\n<p>The <code>&lt;b-pagination&gt;</code> component provides many features to support assistive technology users,\nsuch as <code>aria-</code> attributes and keyboard navigation.</p>\n<h3 id="-aria-controls-"><code>aria-controls</code></h3>\n<p>When pagination is controling another component on the page (such as <code>&lt;b-table&gt;</code>), set\nthe <code>aria-controls</code> prop to the <code>id</code> of the element it is controling. This will help\nnon-sighted users know what component is being updated/controlled.</p>\n<h3 id="aria-labels">ARIA labels</h3>\n<p><code>&lt;b-pagination&gt;</code> provides various <code>*-label-*</code> props which are used to set the <code>aria-label</code>\nattributes on the various elements within the component, which will help users of\nassistive technology.</p>\n<table class="table b-table table-sm table-striped">\n<thead class="thead-default">\n<tr>\n<th>Prop</th>\n<th><code>aria-label</code> content default</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>label-first-page</code></td>\n<td>&quot;Goto first page&quot;</td>\n</tr>\n<tr>\n<td><code>label-prev-page</code></td>\n<td>&quot;Goto previous page&quot;</td>\n</tr>\n<tr>\n<td><code>label-next-page</code></td>\n<td>&quot;Goto next page&quot;</td>\n</tr>\n<tr>\n<td><code>label-last-page</code></td>\n<td>&quot;Goto last page&quot;</td>\n</tr>\n<tr>\n<td><code>label-page</code></td>\n<td>&quot;Goto page&quot;, appended with the page number</td>\n</tr>\n<tr>\n<td><code>aria-label</code></td>\n<td>&quot;Pagination&quot;, applied to the outer pagination container</td>\n</tr>\n</tbody>\n</table>\n<h3 id="keyboard-navigation-support">Keyboard navigation support</h3>\n<p><code>&lt;b-pagination&gt;</code> supports keyboard navigation out of the box.</p>\n<ul>\n<li>Tabbing into the pagination component will autofocus the current page button</li>\n<li><kbd>LEFT</kbd> and <kbd>RIGHT</kbd> arrow keys will focus the previous and next buttons in the page\nlist, respectively, and <kbd>ENTER</kbd> or <kbd>SPACE</kbd> keys will select (click) the focused page button</li>\n</ul>\n<h2 id="events">Events</h2>\n<p><code>&lt;b-pagination&gt;</code> provides two events that are emitted on the component:</p>\n<ul>\n<li><code>input</code> is emitted anytime the current page changes (either programmatically or via user interaction)</li>\n<li><code>change</code> is emitted only when the current page changes based on user interaction</li>\n</ul>\n<p>Both events provide the single argument of the current page number (starting from 1)</p>\n<h2 id="see-also">See Also</h2>\n<p>For navigation based pagination, please see the <a href="./pagination-nav"><code>&lt;b-pagination-nav&gt;</code></a>\ncomponent.</p>\n<h2 id="component-reference">Component Reference</h2>\n'}});
